import React from 'react';

/**
 * Placeholder component for the Reset page.  Future
 * implementations can provide controls to reset application
 * state or clear uploaded data.  Currently, it contains
 * placeholder content.
 */
function Reset() {
  return (
    <div>
      <h2>Reset</h2>
      <p>Placeholder</p>
    </div>
  );
}

export default Reset;
